function App() {

  var gapi = window.gapi
  const API_KEY = "AIzaSyDjOmUfOFphy62WfxzbK4sZWabX5mC6a2A"
  const CLIENT_ID = "289358638150-bhonr4g2buq9tftbbss39cqbofc9duag.apps.googleusercontent.com"
  const CLIENT_SECRET = "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"
  const DISCOVERY_DOCS = 'https://www.googleapis.com/discovery/v1/apis/calendar/v3/rest';
  const SCOPES = 'https://www.googleapis.com/auth/calendar.readonly';

const handleClick = ()=>{
  gapi.load('client:auth2',()=>{
    console.log('load client')

    gapi.client.init({
      apiKey:API_KEY,
      clientId:CLIENT_ID,
      discoveryDocs:DISCOVERY_DOCS,
      scope:SCOPES,
    })

    gapi.client.load('calendar',"v3",()=> console.log("bom"))

    gapi.auth2.getAuthInstance().signIn()
    .then(()=>{
      var event = {
        'summary': 'Google I/O 2015',
        'location': '800 Howard St., San Francisco, CA 94103',
        'description': 'A chance to hear more about Google\'s developer products.',
        'start': {
          'dateTime': '2015-05-28T09:00:00-07:00',
          'timeZone': 'America/Los_Angeles'
        },
        'end': {
          'dateTime': '2015-05-28T17:00:00-07:00',
          'timeZone': 'America/Los_Angeles'
        },
        'recurrence': [
          'RRULE:FREQ=DAILY;COUNT=2'
        ],
        'attendees': [
          {'email': 'lpage@example.com'},
          {'email': 'sbrin@example.com'}
        ],
        'reminders': {
          'useDefault': false,
          'overrides': [
            {'method': 'email', 'minutes': 24 * 60},
            {'method': 'popup', 'minutes': 10}
          ]
        }
      };

    })
  })
}

  return (
    <>
    <div className="container">
      <button onClick={handleClick}>
        Add Event
      </button>
    </div>
    </>
  );
}

export default App;
